<template>
  <div>
    <v-card
        style="margin-top: 20px;"
        class="mx-auto"
        max-width="400"
    >
        <v-card-title class="d-flex justify-center" style="font-size: 30px;">
           EQR Generation Success!
        </v-card-title>
        <div class="d-flex justify-center">
            <qrcode-vue :value="this.url" size="300" level="H"></qrcode-vue>
        </div>
        <v-card-actions>
        <v-btn
            color="green"
            @click="downloadQR"
            block
            style="color: white;"
        >
            Download Emergency QR
        </v-btn>
        </v-card-actions>
    </v-card>
  </div>
</template>

<script>
import QrcodeVue from 'qrcode.vue'
import db, {storage} from '@/firebase/init'
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

export default {
    data() {
        return {
            url: null
        }
    },
    components: {
      QrcodeVue,
    },
    created() {
        db.collection('EmergencyLocations').doc(this.$route.params.id)
        .get().then(doc => {
            this.url = doc.data().url
        })
    },
    methods: {
        downloadQR(){
                       var docDefinition = {
                    pageSize: {
                        width: 300,
                        height: 400 
                    },
                    background: function () {                 
                     return    {
                            canvas: [
                                {
                                    type: 'rect',
                                    x: 0, y: 0, w: 300, h: 400,
                                    linearGradient: ['#FFFFFF', '#F44336'],
                                }
                            ],
                        };
                    },
                    content: [
                        {
                        margin: [0,0,0,0],
                        alignment: 'center',
                        width:130,
                        image: 'data:image/png;base64,'
                    },
                    { 
                        fit:180,
                        alignment: 'center',
                        margin:[0,20,0,0],
                        qr: this.url
                    },
                    {
                        margin:[0,20,0,0],
                        alignment: 'center',
                        text: 'SCDF Emergency QR',
                        fontSize: 20,
                        bold: true
                    },
                    {
                        margin:[0,10,0,0],
                        alignment: 'center',
                        text: 'Scan the QR above only in the event of an emergency! Please provide your contact and your location!',
                        fontSize: 10,
                    },
                    ]
                };
                pdfMake.createPdf(docDefinition).download('EQR');
        }
    }
}
</script>

